,2,'_et_pb_old_content','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://summitcountys1.wpenginepowered.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->'),(82,2,'_et_gb_content_width',''),(83,2,'footnotes',''),(84,2,'_edit_last','1'),(85,2,'_et_pb_post_hide_nav','default'),(86,2,'_et_pb_page_layout','et_right_sidebar'),(87,2,'_et_pb_side_nav','off'),(88,2,'_yoast_wpseo_content_score','90'),(89,2,'_yoast_wpseo_estimated-reading-time-minutes','1'),(90,2,'_yoast_wpseo_wordproof_timestamp',''),(93,25,'_edit_lock','1711855549:1'),(94,25,'_et_pb_use_builder','on'),(95,25,'_et_gb_content_width',''),(96,25,'footnotes',''),(97,25,'_edit_last','1'),(98,25,'_et_pb_post_hide_nav','default'),(99,25,'_et_pb_page_layout','et_right_sidebar'),(100,25,'_et_pb_side_nav','off'),(101,25,'_yoast_wpseo_estimated-reading-time-minutes','0'),(10